import React, { Component } from 'react'
import images from '../data'

export default class ImageList extends Component {
    render() {
        return (
            <div>
                {images.map(image => {
                    return <li>
                        <h3>{image.keyword}</h3>
                        <img alt="animal" src={image.url}/>
                    </li>
                })}
            </div>
        )
    }
}
